- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of the
    Commission?s letter dated February 11, 2009 regarding the Committee?s Amended
    July 2008 Monthly Report (06/01/08 ? 06/30/08).  The Committee?s response is as
    follows:    The Column B total on the Detailed Summary Page has been amended to
    reflect the correct year-to-date amount.  The totals on Column B line 21 and 32
    have been amended to reflect the correct year-to-date amounts.  The memo entries
    have been amended to reflect DNC Victory Fund.  Please note that no employee spent
    more than 25% of his/her time on federal election activity or in connection with
    a federal election. Therefore, salaries, taxes and related expenses were correctly
    reported on H4 of the Committee?s report.  The H2 ratio previously omitted has
    been included in this amended report.  The payment for Political Consulting was
    for generic services and was not payment to staff of the Committee.  The consultant
    did not spend more than 25% of his/her time on federal election activity or in
    connection with a federal election. Therefore, the payment was correctly reported
    on H4 of the Committee?s report.  Please note that the payments for communications,
    printing, printing/graphics/telephone/communications/telephone calls were administrative
    expense for the Committee.  These payments were not federal election activity
    or made in connection with a federal election. Therefore, the payments were correctly
    reported on H4 of the Committee?s report.  The contribution received from the
    Federal Candidate has been amended to correctly report on Line 11(c).  If you
    have any questions, please contact the Committee.\n"
